import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Login from './src/components/Login';
import Register from './src/components/Register';
import Dashboard from './src/components/Dashboard';
import Admin from './src/components/Admin';
import Books from './src/components/books/Books';
import BookDetail from './src/components/books/BookDetail';
import AddBook from './src/components/books/AddBook';
import EditBook from './src/components/books/EditBook';
import Loans from './src/components/loans/Loans';
import LoanDetail from './src/components/loans/LoanDetail';
import AuthContextProvider from './src/contexts/AuthContext.js';

function App() {
  return (
    <AuthContextProvider>
      <Router>
        <Switch>
          <Route path="/login" component={Login} />
          <Route path="/register" component={Register} />
          <Route path="/dashboard" component={Dashboard} />
          <Route path="/admin" component={Admin} />
          <Route exact path="/books" component={Books} />
          <Route path="/books/:id" component={BookDetail} />
          <Route path="/add-book" component={AddBook} />
          <Route path="/edit-book/:id" component={EditBook} />
          <Route exact path="/loans" component={Loans} />
          <Route path="/loans/:id" component={LoanDetail} />
          <Route path="/" component={Login} />
        </Switch>
      </Router>
    </AuthContextProvider>
  );
}

export default App;
